function UserList() {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    async function fetchUsers() {
      try {
        setLoading(true);
        const response = await fetch('https://api.example.com/users');
        
        if (!response.ok) {
          throw new Error('Error en la respuesta del servidor');
        }
        
        const data = await response.json();
        setUsers(data);
        setError(null);
      } catch (err) {
        setError(err.message);
        setUsers([]);
      } finally {
        setLoading(false);
      }
    }

    fetchUsers();
  }, []); // Array vaco significa que se ejecuta solo al montar

  if (loading) return <div>Cargando...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <ul>
      {users.map(user => (
        <li key={user.id}>{user.name}</li>
      ))}
    </ul>
  );
}`})})})]}),u.jsxs("div",{children:[u.jsx("h3",{className:"text-xl font-semibold text-slate-800 dark:text-white mb-2",children:"Librera Axios"}),u.jsx("p",{className:"text-slate-600 dark:text-slate-300",children:"Axios es una biblioteca popular para realizar solicitudes HTTP en JavaScript. Ofrece una API ms fcil de usar que fetch, soporte automtico para JSON, transformacin de solicitudes y respuestas, cancelacin de solicitudes, y mejor manejo de errores."}),u.jsx("div",{className:"bg-slate-100 dark:bg-slate-700 rounded-lg p-4 mt-3 overflow-x-auto",children:u.jsx("pre",{className:"text-slate-800 dark:text-slate-200 text-sm",children:u.jsx("code",{children:`// Usando Axios
