const [posts, setPosts] = useState<Post[]>([]);
const [loading, setLoading] = useState<boolean>(true);
const [error, setError] = useState<string | null>(null);
const [searchTerm, setSearchTerm] = useState<string>('');
const [showOnlyFirst5, setShowOnlyFirst5] = useState<boolean>(true);

// Efecto para cargar datos de la API
useEffect(() => {
  const fetchPosts = async () => {
    try {
      setLoading(true);
      const response = await axios.get<Post[]>(
        'https://jsonplaceholder.typicode.com/posts'
      );
      setPosts(response.data);
      setError(null);
    } catch (err) {
      setError('Error al cargar los datos');
      setPosts([]);
    } finally {
      setLoading(false);
    }
  };

  fetchPosts();
}, []);

// Filtrar posts basados en el trmino de bsqueda
const filteredPosts = posts.filter((post) => 
  post.title.toLowerCase().includes(searchTerm.toLowerCase())
);

// Posts a mostrar basados en el filtro de mostrar solo 5
const postsToDisplay = showOnlyFirst5 
  ? filteredPosts.slice(0, 5) 
  : filteredPosts;

// Manejador de evento para el cambio en la bsqueda
const handleSearchChange = (e: React.ChangeEvent<HTMLInputElement>) => {
  setSearchTerm(e.target.value);
};

// Manejador de evento para el botn de mostrar ms/menos
